import React from 'react';

import './Main.css';

channel = {
    name: 'Fake channel'
}

const Main = () => (

   <div className="main">

        <div className="channels">
          <h5 align="center">List of the channels:</h5>
          <div>
            <ul>
              <li>
                {channel.name}
              </li>
            </ul>
          </div>
        </div>

   </div>
)

export default Main;
